import schedule from '../../svg/mainMenu/menuSchedule.svg';
import cancel from '../../svg/mainMenu/menuCancel.svg';
import energy from '../../svg/mainMenu/menuEnergy.svg';

class Menu extends Component {
  // handle svg file with arrows
  constructor(props) {
    super(props)
    this.page = { page: 1}
    this.pages = {pages: [energy, schedule, appliances, cancel]}
  }
  
  
  render(){

    return (
      <div className="equi">
        <div className="rectangleCable"/> 

      </div>
    );
  }
}

export default Menu;
